import React from 'react';
import './Home.css';

export default function Home() {
  return (
    <div className = 'Home'>
        <div className='Carrousel'>
           Carrousel 
        </div>
        <div className='img-l'>
           img.1 
        </div>
        <div className='img-2'>
           img.2 
        </div>
        <div className='img-3'>
           img.4 
        </div>
        <div className='img-4'>
           img.4 
        </div>
    </div>
  );
}
